import styled from 'styled-components';

function TextBox({ title, desc }) {
    // const textContents = {
    //     title: '',
    //     desc: '',
    // };

    // const { title, desc } = textContents;

    return (
        <TextWrap>
            <Title>{title}</Title>
            <Desc>{desc}</Desc>
        </TextWrap>
    );
}

const TextWrap = styled.div``;
const Title = styled.p`
    color: ${({ theme }) => theme.colors.blue};
`;
const Desc = styled.p``;

export default TextBox;
